import { useState } from "react";

const Todo = () => {
  const todosList = [
    {
      id: 1,
      content: "店予約する",
    },
    {
      id: 2,
      content: "卵買う",
    },
    {
      id: 3,
      content: "郵便出す",
    },
  ];

  const [toggle, setToggle] = useState;

  const togglecomplete = (task) => {
    task["toggle"] = !task["toggle"];
    setToggle(true);
  };

  return (
    <>
      <div>
        {todosList.map((task) => (
          <button key={task.content} onClick={togglecomplete}>
            完了
          </button>
        ))}
      </div>
    </>
  );
};

export default Todo;
